import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';
import axios from 'axios';

const pertanyaanList = [
  'Batuk Lebih Dari 2 Minggu',
  'Demam',
  'Berkeringat Malam Hari Tanpa Aktivitas',
  'Sesak Nafas',
  'Nyeri Dada',
  'Ada benjolan di leher/bawah rahang/bawah telinga/ketiak',
  'Batuk berdarah',
  'Batuk kurang dari 2 minggu',
  'Nafsu makan turun',
  'Mudah lelah',
  'Berat badan turun',
  'Anggota keluarga serumah ada yang sakit TBC',
  'Pernah berada satu ruangan dengan penderita TBC',
  'Tinggal serumah dengan penderita TBC minimal satu malam/sering siang hari',
  'Pernah Berobat TBC tuntas',
  'Pernah berobat TBC tapi tidak tuntas',
  'Punya riwayat diabetes melitus/kencing manis',
  'Orang dengan HIV',
  'Ibu Hamil',
  'Merokok',
  'Usia 0-14 Tahun',
  'Lansia (Diatas 60 Tahun)',
];

const convertJawaban = (val) => {
  if (val === null || val === undefined || val === '') return '-';
  const clean = String(val).toLowerCase().trim();
  if (clean === 'ya' || clean === '1') return 'Ya';
  if (clean === 'tidak' || clean === '0') return 'Tidak';
  return 'Tidak tersedia';
};

function DetailScreening() {
  const { id } = useParams();
  const [item, setItem] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchDetail = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/detail-screening/${id}`);
        const data = response.data;

        const sessionUser = JSON.parse(sessionStorage.getItem('user'));
        if (!sessionUser || (sessionUser.role !== 'admin' && sessionUser.user_id !== data.user_id)) {
          alert('Anda tidak memiliki akses ke data ini.');
          navigate('/');
          return;
        }

        setItem(data);
      } catch (error) {
        console.error('Gagal mengambil detail screening:', error);
        alert('Terjadi kesalahan saat mengambil data.');
      }
    };

    fetchDetail();
  }, [id, navigate]);

  if (!item) {
    return <div className="text-center mt-5">Memuat detail screening...</div>;
  }

  const jawabanArray = pertanyaanList.map((_, index) => {
    const key = `q${index + 1}`;
    return item[key];
  });

  return (
    <>
      <Header />
      <div className="container mt-5 mb-5">
        <h3 className="mb-3">📝 Detail Screening</h3>
        <p>👤 <strong>Nama:</strong> {item.nama_pasien}</p>
        <p>📅 <strong>Tanggal:</strong> {new Date(item.tanggal_screening).toLocaleDateString('id-ID', {
          day: 'numeric', month: 'long', year: 'numeric'
        })}</p>
        <p>📈 <strong>Probabilitas:</strong> {(item.probabilitas * 100).toFixed(2)}%</p>
        <p>⚠️ <strong>Hasil:</strong> {item.hasil}</p>

        <div className="mt-4">
          <h5>🗒️ Jawaban:</h5>
          <ul className="list-group">
            {pertanyaanList.map((pertanyaan, index) => (
              <li key={index} className="list-group-item d-flex justify-content-between align-items-center">
                <span>{index + 1}. {pertanyaan}</span>
                <span className={`badge ${convertJawaban(jawabanArray[index]) === 'Ya' ? 'bg-danger' : convertJawaban(jawabanArray[index]) === 'Tidak' ? 'bg-success' : 'bg-secondary'}`}>
                  {convertJawaban(jawabanArray[index])}
                </span>
              </li>
            ))}
          </ul>
        </div>
      </div>
      <Footer />
    </>
  );
}

export default DetailScreening;
